// frontend/src/HelloPage.js
import React from "react";
import { useLocation } from "react-router-dom";

function HelloPage() {
    const location = useLocation();
    const message = location.state?.message || "No message provided";

    return (
        <div>
            <h1>{message}</h1>
        </div>
    );
}

export default HelloPage;
